import Grid from '@mui/material/Grid'
import Apps from './Apps'

function AppBox() {

  return (
    <Grid container spacing={2} justifyContent="center" display="flex" sx={{ pt: 4 }}>
      <Apps title='qwe'/>
      <Apps title='qwe2' />
      <Apps title='qwe4' />
    </Grid>
  )
}

export default AppBox;
